import React, { Component } from 'react';
import Cookies from 'universal-cookie';
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit, faTrashAlt } from '@fortawesome/free-solid-svg-icons';
import { Modal, ModalBody, ModalFooter, ModalHeader } from 'reactstrap';
const url = "http://localhost:62856/api/USUARIOs";
const cookies = new Cookies();

class MenuAdmin extends Component {

    state={
        data:[]
    }

    peticionGet=()=>{
        axios.get(url).then(response=>{
            console.log("DATA USUARIOS" , response.data)
            this.setState({data: response.data});
        })
    }


    componentDidMount(){
        // if(!cookies.get('nombre')){
        //     window.location.href="./"
        // }
        this.peticionGet();
    }


    cerrarSesion=()=>{
        cookies.remove('id',{path:"/"});
        cookies.remove('nombre',{path:"/"});
        cookies.remove('apellido',{path:"/"});
        cookies.remove('rol',{path:"/"});
        window.location.href='./'
    }

    render() {
        return (

        <body>
            
            <header>
                 <div>
                     <button onClick={()=>this.cerrarSesion()}>Cerrar sesi√≥n</button>
                </div>
            </header>

            <div className="App">
                <br/>
                <button className="btn btn-success">Agregar Usuario</button>
                <br/>  <br/>
                <table className="table">
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>Nombre</th>
                            <th>Apellido</th>
                            <th>Email</th>
                            <th>Direccion</th>
                            <th>Telefono</th>
                            <th>Estado</th>
                            <th>Rol</th>

                        </tr>
                    </thead>
                    <tbody>
                       {this.state.data.map(usuario=>{
                            return(
                                <tr>
                                    <td>{usuario.ID}</td>
                                    <td>{usuario.NOMBRE}</td>
                                    <td>{usuario.APELLIDO}</td>
                                    <td>{usuario.EMAIL}</td>
                                    <td>{usuario.DIRECCION}</td>
                                    <td>{usuario.TELEFONO}</td>
                                    <td>{usuario.ACTIVO}</td>
                                    <td>{usuario.ROLID}</td>
                                    <td>
                                        <button className="btn btn-primary"> <FontAwesomeIcon icon={faEdit}/></button>
                                        {"    "}
                                        <button className="btn btn-primary"> <FontAwesomeIcon icon={faTrashAlt}/></button>
                                    </td>
                                </tr>
                            )
                       })}
                    </tbody>
                </table>

                    <modal>
                            <ModalHeader style={{display:'block'}}>
                                        <span style={{float: 'right'}}>x</span>
                            </ModalHeader>
                            <ModalBody>
                                <div className="form-group">
                                    <label htmlFor="id">ID</label>
                                    <input className="form-control" type="text" name="id" id="id" readOnly></input>
                                </div>
                            </ModalBody>


                    </modal>
            </div>
         </body>
  

        
       


        );
    }
}

export default MenuAdmin;
